import React from 'react';
import './Marker.css';

const Marker = (props) => {
  const { color, name, id } = props;
  return (
    <div>

      <div
        className="pin bounce"
        style={{ backgroundColor: color, cursor: 'pointer' }}
        title={name}
      />
      <div className="pulse" />
      <br />
      <br />
      <p>
        <font size="4"
          face="Comic sans MS"
          color="red">
          {name}
        </font>
      </p>

    </div>
  );
};

export default Marker;
